	//解析
	public List<ClockPortESObject> analysisClockPort(byte[] command, CXNEObject CXNEObject){
		List<ClockPortESObject> lcp = new ArrayList<ClockPortESObject>();
		List<ClockPortESObject> lcpe = new ArrayList<ClockPortESObject>();
		List<ClockPortESObject> lcps = new ArrayList<ClockPortESObject>();
		List<ClockPortESObject> lcpp = new ArrayList<ClockPortESObject>();
		int re=0;
		int start = 49;
		byte[] tt = command;
		byte[] t = new byte[tt.length - start];
		
//		System.arraycopy(tt, start, t, 0, tt.length - start);
//		lcp = super.analysisTabble("clockport", t);
//		return lcp;
		System.arraycopy(tt, start, t, 0, tt.length - start);
		List<byte[]> lbe = new ArrayList<byte[]>(2);
		bytedelete0x00(t,lbe);
		byte[] beth = lbe.get(0);
//		System.out.println("-beth--"+print16String(beth));		
		if(beth != null){lcpe = super.analysisTabble("clockport", beth); }
		List<byte[]> lbsp = new ArrayList<byte[]>(2);
		bytedelete0x00(lbe.get(1),lbsp);
		byte[] bsdh = lbsp.get(0);
		byte[] bpdh = lbsp.get(1);
//System.out.println("-bsdh--"+print16String(bsdh));	
//System.out.println("-bpdh--"+print16String(bpdh));	
		if(bsdh != null){lcps = super.analysisTabble("clockport", bsdh); }
		if(bpdh != null){lcpp = super.analysisTabble("clockport", bpdh);}
		lcp.addAll(lcpe);
		lcp.addAll(lcps);
		lcp.addAll(lcpp);	
		//lcp=super.analysisTabble("clockport", t);
		
		return lcp;
	}
