	//生成查询命令
	public byte[] selectClockPort_(ClockPortESObject clock,int session, int seqid){
		List<CxtOpItem> cxtOpItems = new ArrayList<CxtOpItem>();
		String s = null;
		cxtOpItems.add(begin(3))  ;
		cxtOpItems.add(cd("ne/interfaces/eth/"+clock.getPortname()+"/clock"));
		cxtOpItems.add(get("clock", 2)) ;
		cxtOpItems.add(cd("ne/interfaces/sdh/"+clock.getPortname()+"/clock"));
		cxtOpItems.add(get(s, 2)) ;
		cxtOpItems.add(cd("ne/interfaces/pdh/"+clock.getPortname()+"/clock"));
		cxtOpItems.add(get(s, 2)) ;
		
		byte[] command = getCommandBytes(cxtOpItems);
		command = getHeaderCommandBytes(CoreOper.ECXTMSG_REQ_OPS, command, session, seqid);
		return command;
	}
	//删除
	public byte[] deleteClockPort(ClockPortESObject clock, int session, int seqid){
		List<CxtOpItem> cxtOpItems = new ArrayList<CxtOpItem>();
		String path ;
		if(clock.getPortname().indexOf("ge")>=0||clock.getPortname().indexOf("xg")>=0){
			path = "ne/interfaces/eth/"+clock.getPortname();
		}else if(clock.getPortname().indexOf("stm")>=0){
			path = "ne/interfaces/sdh/"+clock.getPortname();
		}else if(clock.getPortname().indexOf("pdh")>=0){
			path = "ne/interfaces/pdh/"+clock.getPortname();
		}else {
			System.out.println("clock delete error!!!. ");
			return new byte[]{};
		}	
		cxtOpItems.add(begin(3))  ;
		cxtOpItems.add(cd(path));
		cxtOpItems.add(set("dnugroup", "0"));
		cxtOpItems.add(set("ssmoutputenable", "false"));
		cxtOpItems.add(delete("clock"));
		cxtOpItems.add(commit());;
		
		byte[] command = getCommandBytes(cxtOpItems);
		command = getHeaderCommandBytes(CoreOper.ECXTMSG_REQ_OPS, command, session, seqid);
		return command;
	}
	//创建
	public byte[] createClockPort(ClockPortESObject clock, int session, int seqid){
		if(clock==null)return new byte[]{};
		List<CxtOpItem> cxtOpItems = new ArrayList<CxtOpItem>();
		
		List<CxtAtomType> cxtAtomTypes = new ArrayList<CxtAtomType>();
		cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, "scspri"));//13,00000000
		cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_NUM_32, clock.getScspri() ));
		cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, "ecspri"));//13,00000000
		cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_NUM_32, clock.getEcspri() ));
		cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, "scslockout"));//01,00
		cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, clock.getScslockout() ));
		cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, "ecslockout"));//01,00
		cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, clock.getEcslockout() ));
		cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, "dnugroup"));//13,00000000
		cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_NUM_32, clock.getDnugroup() ));
		cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, "forcelevel"));//13,000000ff
		cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_NUM_32, clock.getForcelevel() ));
		//cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, "PhysicalState"));//物理状态
		//cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, clock.getPhysicalState() ));
//		cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, "ssmoutputenable"));//01,01
//		cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, clock.getSsmoutputenable() ));
		
		CxtATTable cxtATTable = getCxtATTable(cxtAtomTypes.size() / 2, cxtAtomTypes);
		
		cxtOpItems.add(begin(3));		
		String path ;
		if(clock.getPortname().indexOf("ge")>=0||clock.getPortname().indexOf("xg")>=0||
				clock.getPortname().indexOf("fe")>=0||clock.getPortname().indexOf("fx")>=0){
			path = "ne/interfaces/eth/"+clock.getPortname();
		}else if(clock.getPortname().indexOf("stm")>=0){
			path = "ne/interfaces/sdh/"+clock.getPortname();
		}else if(clock.getPortname().indexOf("e1")>=0){
			path = "ne/interfaces/pdh/"+clock.getPortname();
		}else {
			System.out.println("clock create error. ");
			return new byte[]{};
		}	
		cxtOpItems.add(cd(path));
		cxtOpItems.add(create("clock", cxtATTable));
	//	cxtOpItems.add(get());
		cxtOpItems.add(setNum("dnugroup", clock.getDnugroup()));//13,00000000
		cxtOpItems.add(set("ssmoutputenable", clock.getSsmoutputenable())); //01,01		
		cxtOpItems.add(commit());
		byte[] command = getCommandBytes(cxtOpItems);
		command = getHeaderCommandBytes(CoreOper.ECXTMSG_REQ_OPS, command, session, seqid);

		return command;
	}
	//生成更新 update命令
	public byte[] updateClockPort(ClockPortESObject clock, int session, int seqid){
		if(clock==null)return new byte[]{};
		List<CxtOpItem> cxtOpItems = new ArrayList<CxtOpItem>();
		
		List<CxtAtomType> cxtAtomTypes = new ArrayList<CxtAtomType>();
		if(have(clock.getScspri())){
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, "scspri"));//13,00000000
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_NUM_32, clock.getScspri() ));
		}
		if(have(clock.getEcspri())){
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, "ecspri"));//13,00000000
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_NUM_32, clock.getEcspri() ));
		}
		if(have(clock.getScslockout())){
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, "scslockout"));//01,00
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, clock.getScslockout() ));
		}
		if(have(clock.getEcslockout())){
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, "ecslockout"));//01,00
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, clock.getEcslockout() ));
		}
		if(have(clock.getDnugroup())){
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, "dnugroup"));//13,00000000
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_NUM_32, clock.getDnugroup() ));
		}
		if(have(clock.getForcelevel())){
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, "forcelevel"));//13,000000ff
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_NUM_32, clock.getForcelevel() ));
		}
		//以下供转换使用
		if(have(clock.getScsmanual())){
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, "scsmanual"));//01,00
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_BOOL, clock.getScsmanual() ));
		}
		if(have(clock.getEcsmanual())){
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, "ecsmanual"));//01,00
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_BOOL, clock.getEcsmanual() ));
		}
		if(have(clock.getScsforce())){
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, "scsforce"));//01,00
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_BOOL, clock.getScsforce() ));
		}
		if(have(clock.getEcsforce())){
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, "ecsforce"));//01,00
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_BOOL, clock.getEcsforce() ));
		}
		if(have(clock.getSsmoutputenable())){
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, "ssmoutputenable"));//01,00
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_BOOL, clock.getSsmoutputenable() ));
		}
		if(have(clock.getSpeed())){
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_STRING, "speed"));//01,00
			cxtAtomTypes.add(getCxtAtomType(CxtAtomType.AT_BOOL, clock.getSpeed() ));
		}
		
		CxtATTable cxtATTable = getCxtATTable(cxtAtomTypes.size() / 2, cxtAtomTypes);
		
		cxtOpItems.add(begin(3));		
		String path ;
		if(clock.getPortname().indexOf("ge")>=0||clock.getPortname().indexOf("xg")>=0||clock.getPortname().indexOf("fe")>=0||clock.getPortname().indexOf("fx")>=0){
			path = "ne/interfaces/eth/"+clock.getPortname();
		}else if(clock.getPortname().indexOf("stm")>=0){
			path = "ne/interfaces/sdh/"+clock.getPortname();
		}else if(clock.getPortname().indexOf("pdh")>=0){
			path = "ne/interfaces/pdh/"+clock.getPortname();
		}
//		else if(clock.getPortname().indexOf("tod")>=0){
//			path = "ne/interfaces/tod/"+clock.getPortname();
//		}
		else {
			System.out.println("clock update error!!!!. ");
			return new byte[]{};
		}	
		cxtOpItems.add(cd(path));
		if(have(clock.getDnugroup())){
			cxtOpItems.add(set("dnugroup", clock.getDnugroup()));
		}
		if(have(clock.getSsmoutputenable())){
			cxtOpItems.add(set("ssmoutputenable", clock.getSsmoutputenable()));	
		}
		if(clock.getPortname().indexOf("pdh")>=0){
			cxtOpItems.add(set("recoverymode", getRecoverymode(clock.getEcslockout()) ));
		}
		cxtOpItems.add(mset("clock", cxtATTable));
//		cxtOpItems.add(cd(path+"clock"));
//		cxtOpItems.add(set("scspri", clock.getScspri()));
//		cxtOpItems.add(set("ecspri", clock.getEcspri()));
//		cxtOpItems.add(set("scslockout", clock.getScslockout()));
//		cxtOpItems.add(set("ecslockout", clock.getEcslockout()));
//		cxtOpItems.add(set("forcelevel", getForceleve(clock.getForcelevel()) ));
		cxtOpItems.add(commit());
		byte[] command = getCommandBytes(cxtOpItems);
		command = getHeaderCommandBytes(CoreOper.ECXTMSG_REQ_OPS, command, session, seqid);

		return command;
	}
