	private boolean have(String s){
		if(null == s ||s.equals(""))return false;
		else{ return true;}
	}
	//类型转换
	private String getForceleve(String level){
		if("1".equals(level))return "prc";
		else if("2".equals(level))return "ssua";
		else if("3".equals(level))return "ssub";
		else if("4".equals(level))return "sec";
		else if("5".equals(level))return "dnu";
		else if("6".equals(level))return "inv";
		else if("255".equals(level))return "auto";
		else return "auto";
	}
	//类型转换
	private String getRecoverymode(String mo){
		if("0".equals(mo))return "tdm"; //从输入TDM信号中恢复
		else if("1".equals(mo))return "emu";
		else return "tdm";
	}
	
