	/**
	 * 由于命令里有多步cd然后get(null,2) 的格式,发现设备每次cd间隔11个0x00.所以人为去掉11个0x00,有助于
	 * **/
	public int bytedelete0x00(byte[] arr,List<byte[]> lb){
		int i=0;
		byte[] tem1  ;
		byte[] tem2  ;
		for(;i<arr.length;i++){
			if(arr[i] == (byte)0x00 ){
				for(int q=1; q<=12&&i<arr.length ; q++,i++){					
					
					if(i < arr.length){
						if(arr[i] != 0x00) break;
						if((arr[i]== 0x00 )&& (q == 12 )  ){
							tem1 = java.util.Arrays.copyOfRange(arr, 0,i-10);
							tem2 = java.util.Arrays.copyOfRange(arr, i+1,arr.length) ;
							System.out.println("i = "+i+" ; t1.le="+tem1.length+" ;t2.le="+tem2.length);
							lb.add(0, tem1);
							lb.add(1, tem2);
							return i;
						}
					}
					
				}
			}
		}	
		return i;
	}
	public byte[] copy(byte[] t1,byte[] t2){
		byte[] tem = new byte[t1.length+t2.length] ;
		System.arraycopy(t1, 0, tem, 0, t1.length);
		System.arraycopy(t2, 0, tem, t1.length, t2.length);
		return tem;
	}

